<script>

var margin = {top: 20, right: 20, bottom: 30, left: 40},
    width = 960 - margin.left - margin.right,
    height = 500 - margin.top - margin.bottom;

var zoom = d3.behavior.zoom()
    .translate([0, 0])
    .scale(1)
    .scaleExtent([1, 8])
    .on("zoom", zoomed);

var svg = d3.select("svg");
var svgG = d3.select("#nsaGraphic");
var overlay = d3.select(".overlay");
overlay.call(zoom);

d3.select("button").on("click", reset);

function zoomed() {
  console.log(d3.event);
  var tn = zoom.translate();
  var sc = zoom.scale();
  svgG.attr("transform", "translate(" + tn + ")scale(" + sc + ")");
}

function reset() {
  d3.transition().duration(750).tween("zoom", function() {
    var interpolateTranslate = d3.interpolate(zoom.translate(), [0,0]),
        interpolateScale = d3.interpolate(zoom.scale(), 1);
    return function(t) {
      zoom
        .translate(interpolateTranslate(t))
        .scale(interpolateScale(t));
      zoomed();
    };
  });
}

</script>
